# # #############          Calculations for p_0         ################################
def p0(U, E_U_k, Gell_Mann_np_array8):
	p0 = 0

	# list for all j=j'!=0
	# 0, 8 & 15 are the only ones for which sigmaj * sigmaj' != 0.5 OR 0
	list_even = [1, 2, 3, 4, 5, 9, 10]
	list_j = [[0, 3, 0.353553390593], [0, 8, 0.204124145232], [0, 15, 0.144337567297], [1, 2, 0.5j], [3, 8, 0.288675134595], [3, 15, 0.204124145232], [4, 5, 0.5j], [8, 15, 0.117851130198], [9, 10, 0.5j]]

	for k in range(0, 3):
		# start with j=j'=0 (sigmaj * sigmaj' [0,0] = 0.25)
		p0 += np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[0]) * np.conj(np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[0])) / 4
		
		# j = j' = 8. right part = 1/6
		p0 += np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[8]) * np.conj(np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[8])) / 6
		
		# j = j' = 15. right part = 1/12
		p0 += np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[15]) * np.conj(np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[15])) / 12 
		
		# add all j=j' from list_even
		for e in list_even:
			p0 += np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[e]) * np.conj(np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[e])) / 2
		# add all combination from list_j
		for j in list_j:
			# uncomment next line for check of third entries in list_j
			# print j[0], j[1], np.dot(Gell_Mann_np_array4[j[0]], Gell_Mann_np_array4[j[1]])[0,0]
			p0 += 2 * np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[j[0]]) * np.conj(np.einsum('ij,ji->', E_U_k[k], Gell_Mann_np_array8[j[1]])) * j[2]
	return p0				







